def get_decimal_value(number):
    decimal_value = 0
    for i in range(len(number)):
        decimal_value += int(number[i]) * 0.5 ** (len(number) - i - 1)
    return decimal_value


def compare_numbers(number1, number2):
    decimal_value1 = get_decimal_value(number1)
