import math

def is_greater(a, b):
    if len(a) > len(b):
        return True
    elif len(a) < len(b):
        return False
    else:
        for i in range(len(a)):
            if int(a[i]) > int(b[i]):
                return True
            elif int(a[i]) < int(b[i]):
                return False
            else:
                continue
        return False

