def gcd(a, b):
    if b == 0:
        return a
    else:
        return gcd(b, a % b)


def lcm(a, b):
    return a * b / gcd(a, b)


def add(a, b):
    return bin(a + b)[2:]


def sub(a, b):
    return bin(a - b)[2:]


def mul(a, b):
    return bin(int(a, 2) * int(b, 2))[2:]


def div(a, b):
    return bin(int(a, 2) // int(b, 2))[2:]


def pow(a, b):
    return bin(int(a, 2) ** int(b, 2))[2:]


def mod(a, b):
    return bin(int(a, 2) % int(b, 2))[2:]
